import React, { useState } from 'react';
import { createProperty } from '../services/propertyService';

function AdminPage() {
    const [property, setProperty] = useState({
        title: '',
        description: '',
        price: '',
        location: '',
        // Add other fields as necessary
    });
    const [message, setMessage] = useState(''); // State to hold the message

    const handleChange = (e) => {
        setProperty({ ...property, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await createProperty(property);
            console.log("Property added:", response);
            setMessage('Property added successfully!'); // Set success message
            // Clear form or take other actions
        } catch (error) {
            console.error("Error adding property:", error);
            setMessage('Failed to add property. Please try again.'); // Set error message
        }
    };

    return (
        <div>
            <h1>Admin Panel</h1>
            <form onSubmit={handleSubmit}>
                {/* Form inputs */}
                <button type="submit">Add/Update Property</button>
            </form>
            {message && <div>{message}</div>} {/* Display message */}
        </div>
    );
}

export default AdminPage;
